import React, { useState } from "react";
function Example() {
  const [count, setCount] = useState(0);
  const [name, setName] = useState("guokai");
  const [age, setAge] = useState(18);
  return (
    <div>
      <p>{(count, name, age)}</p>
      <button
        onClick={() => {
          setCount(count + name + age);
        }}
      >
        点击
      </button>
    </div>
  );
}
export default Example;
